import React from 'react'
import "./Footer.css"

function Footer() {
  return (
  <footer>
    <div className="container">
       <hr />
       <p className='copy'>@2024 Copyright <a className='links' href="#">About</a> <a className='links' href="#">Home</a> <a href="#">FAQs</a></p>
    </div>
  </footer>
  )
}

export default Footer
